import React from "react";
import { Image, Row, Col, Avatar } from "antd";

function AppHeader() {
    return (
        <Row justify="space-between">
            <Col>
                <Image
                    preview={false}
                    width={100}
                    src="data:image/png;base64,"
                />
            </Col>
            <Col>
                Hi, User <Avatar size="small">U</Avatar>
            </Col>
        </Row>
    );
}

export default AppHeader;
